import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import ListItemText from '@material-ui/core/ListItemText';
import ListItem from '@material-ui/core/ListItem';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import CloseIcon from '@material-ui/icons/Close';
import Slide from '@material-ui/core/Slide';
import Input from '@material-ui/core/Input';
import FilledInput from '@material-ui/core/FilledInput';
import OutlinedInput from '@material-ui/core/OutlinedInput';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
import CardContent from '@material-ui/core/CardContent';

const useStyles = makeStyles((theme) => ({
    root: {
        width: '40vw',
        height: '100%',
        margin: 0,
        maxWidth: '100%',
        maxHeight: '100%',
        borderRadius: 0,
    }
    ,


    appBar: {
        position: 'relative',
    },
    title: {
        marginLeft: theme.spacing(2),
        flex: 1,
    },
    btn: {
        margin: 'auto',
        marginBottom: '20px'
    },

    margin: {
        margin: theme.spacing(1),
        maxWidth: '480px',
        padding: '10px',
    },
    withoutLabel: {
        marginTop: theme.spacing(3),
    },
    textField: {
        width: '20px',
    },
    logo: {
        marginTop: 'auto',
        maxWidth: '100px',
        margin: 'auto',
        position:'relative' ,
        float:'right'
      }
}));

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="left" ref={ref} {...props} />;
});

const ABMMedicoForm = ({}) => {
    const classes = useStyles();



    const handleClickOpen = () => {

    };

    const setOnShowSuccessPage_ = () => {         


    };

    const handleClose = () => { 


    };

    const [values, setValues] = useState({
        nombres: '',
        appellidos: '',
        dni: '',
        email: '',
        mobilePhone: '',
    });

    const handleChange = (prop) => (event) => {
        setValues({ ...values, [prop]: event.target.value });
    };

    const handleClickShowPassword = () => {
        setValues({ ...values, showPassword: !values.showPassword });
    };

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
    };
    return (
        <>
        <div>
               <FormControl fullWidth className={classes.margin} variant="filled">

                   <InputLabel htmlFor="filled-adornment-amount">Nombres</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.nombres}
                       onChange={handleChange('nombres')} 
                   />

               </FormControl>

               <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Appellidos</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.appellidos}
                       onChange={handleChange('appellidos')}
                   />
               </FormControl>

               <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Correco electrónico</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.email}
                       onChange={handleChange('email')}
                   />
               </FormControl>



               <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Dirección</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.direccion}
                       onChange={handleChange('direccion')}
                   />
               </FormControl>
               <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Dirección N° </InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.direccionNbr}
                       onChange={handleChange('direccionNbr')}
                   />
               </FormControl>

     <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Género</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.genero}
                       onChange={handleChange('genero')}
                   />
               </FormControl>
                <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Tipo y Nro de Documento</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.typeAndDocNbr}
                       onChange={handleChange('typeAndDocNbr')}
                   />
               </FormControl>

                   <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Matrícula N°</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.matriculaNbr}
                       onChange={handleChange('matriculaNbr')}
                   />
               </FormControl>


                   <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Estado</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.estado}
                       onChange={handleChange('estado')}
                   />
               </FormControl>

                   <FormControl fullWidth className={classes.margin} variant="filled">
                   <InputLabel htmlFor="filled-adornment-amount">Descripción</InputLabel>
                   <FilledInput
                       id="filled-adornment-amount"
                       value={values.descripcion}
                       onChange={handleChange('descripcion')}
                   />
               </FormControl>
               </div>
               <div>
               <Button  variant="contained" color="primary"   >Cancelar</Button>
               <Button  variant="contained" color="primary"   >Guardar</Button>
               </div>
         </>
    );
}
export default ABMMedicoForm;
